import React, {FC} from 'react';
import Toe, {Type} from "./Toe";

export interface GameProps {
    width?: string,
    height?: string
}

var type: Type = Type.none;

const Game: FC<GameProps> = (
    {
        width = '300px',
        height = '300px'
    }) => {
    return (
        <div
            style={{
                width,
                height,
                display: 'flex',
                flexWrap: 'wrap',
                alignItems: 'center',
                justifyContent: 'space-around'

            }}
        >
            <Toe onClick={() => f(curType)} type={TypeInit(curType)}/>

        </div>
    );

};
var curType: Type  = Type.type_x;
function f(type:Type){
    return type;
}

const SwitchType = (e: Type | undefined) => {
    console.log('SwitchType working');
    if (e == undefined) console.log('e is undefined');
    if (e == Type.none) {
        e = Type.type_o;
        curType = Type.type_o
    } else if (e == Type.type_o) {
        e = Type.type_x;
        curType = Type.type_x
    } else {
        e = Type.type_o;
        curType = Type.type_o;
    }
}

const TypeInit = (e: Type | undefined) => {
    if (e == undefined) return Type.none;
    else if (e == Type.type_o) return Type.type_o;
    else return Type.type_x;
}

export default Game;
